import React, {Component} from 'react';
import {connect} from 'react-redux';
import * as actions from '../actions';
import BackgroundImage from '../components/BackgroundImage/BackgroundImage';
import "./Home.scss";
import {apiUrl} from "../constants";
import axios from 'axios';
import "bootstrap/dist/css/bootstrap.min.css";
import "shards-ui/dist/css/shards.min.css"
import { FormCheckbox } from "shards-react";
import { Container, Row, Col } from "shards-react";

class Home extends Component {
    state = {
        loading: false,
    };


    componentWillReceiveProps(nextProps, nextContext) {
        this.setState({});
    }

    componentWillMount() {

    }

    componentDidMount() {

    }


    render() {


        return (
            <div className="home-page-container">
                <BackgroundImage/>
                <div className={'form-container'}>
                    <div className={'heading1'}>PRE-QUALIFY FOR THE</div>
                    <div className={'heading2'}>BIG RACE</div>
                    <h4 className={'heading3'}>
                        To begin, please answer a few simple questions:
                    </h4>

                    <Container className={'form'}>
                        <Row>
                            <Col>
                                <div className={'heading4'}>
                                    ARE YOU?
                                </div>
                            </Col>
                        </Row>
                        <Row>
                            <Col sm={12}>
                                <FormCheckbox
                                    checked={this.state.orange}
                                    onChange={e => this.handleChange(e, "orange")}
                                >
                                    Orange
                                </FormCheckbox>
                            </Col>
                            <Col sm={12}>
                                <FormCheckbox
                                    checked={this.state.orange}
                                    onChange={e => this.handleChange(e, "orange")}
                                >
                                    Orange
                                </FormCheckbox>
                            </Col>
                        </Row>
                    </Container>

                </div>


            </div>
        );
    }
}

const mapStateToProps = (state) => {

    const {user} = state.user;
    return {
        user
    };
}

export default connect(mapStateToProps)(Home);
